	[1] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>裂空座、水君</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249003>锋矢阵。</div>妙蛙种子负责嘲讽敌方前排宝可梦，水君可以提高我方输出的生存能力；裂空座可以在压低敌方血线的同时有几率沉默对手，最后由我方其他物攻宝可梦进行收割。",hero_list={{30402,30508,30501,20508,10501}},id=1,limit=0,name="新手推荐",sort=100},
	[2] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>超梦、凤王</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249003>地绝阵。</div>凤王的[生命火种]使我方单位打出暴击时获得生命回复，雷公【破甲】提供增伤，谢米保护后排宝可梦，配合物攻队伍能提供一定的生存同时又有较高的输出能力。",hero_list={{20507,10505,30502,40506,50504}},id=2,limit=0,name="初级推荐1",sort=101},
	[3] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>雷吉艾斯、盖欧卡、急冻鸟</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249004>地绝阵。</div>杰尼龟能为我方宝可梦提高保护，雷吉艾斯用来提高我方的生存能力，再由急冻鸟的冰冻使对手无法行动，最后由盖欧卡与洛奇亚担任主力输出。",hero_list={{10504,10505,10511,10510,10502}},id=3,limit=0,name="水系最强",sort=110},
	[4] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>莱希拉姆、凤王、固拉多</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249005>地绝阵。</div>莱希拉姆的四技能可以大幅提高【灼烧】伤害，固拉多和炎帝都可以为敌方附加【灼烧】状态，配合凤王的暴击回复可以产生极高的治疗量，固拉多和快龙都是优秀的防御型宝可梦可以在前排承担伤害。",hero_list={{20508,20511,20507,20510,20504}},id=4,limit=0,name="火系最强",sort=111},
	[5] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>裂空座、蒂安希、基拉祈</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249006>地绝阵。</div>裂空座能有效对对手造成输出与控制效果，基拉祈提高我方整体输出，复活友军的特性可以提高我方的容错，谢米与蒂安希能保护我方输出宝可梦，雷吉奇卡斯可作为我方输出主力。",hero_list={{30508,30502,30507,30511,30509}},id=5,limit=0,name="草系最强",sort=112},
	[6] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>胡帕、骑拉帝纳、达克莱伊</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249007>圣灵阵。</div>蒂安希多拉负责为我方提供续航，同时降低对手的输出。骑拉帝纳提供增益buff并随机转移一个debuff给敌方单位，胡帕变身后可以打出极高的爆发伤害，达克莱伊压低敌方血线，最后配合超梦点杀敌方单位。",hero_list={{50509,50507,50504,50510,50508}},id=6,limit=0,name="暗系最强",sort=113},
	[7] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>酋雷姆、皮卡丘、凯西</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249008>地绝阵。</div>酋雷姆在纯光队伍中可以打出高额爆发，皮卡丘可清除对手的增益Buff并造成大量伤害，凯西驱散负面状态提升我方伤害，配合雷公可在第二回合打出超高爆发，梦幻优秀的回复，使队伍具有极高的续航和输出能力",hero_list={{40507,40506,40503,40509,40508}},id=7,limit=0,name="光系最强",sort=114},
	[8] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>水君、快龙</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249003>圣灵阵。</div>水君可以提升我方输出能力，梦幻与水君的双复活保证续航和容错，快龙作为防御宝可梦保护我方中后排宝可梦，裂空座超梦都是优秀的输出宝可梦在增益buff的加持下打出高额伤害。",hero_list={{20511,30508,50504,40507,10501}},id=8,limit=0,name="初级推荐2",sort=102},
	[9] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>雷吉奇卡斯、凤王、莱希拉姆</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249003>地绝阵。</div>雷吉奇卡斯适合半防半输出的宝石配置，在第二回合打出超高伤害，莱希拉姆变身后可以打出高额的爆发，配合裂空座点杀残血单位，凤王和蒂安希能为队伍提供不俗的回复能力。",hero_list={{20507,20510,30507,30508,30509}},id=9,limit=0,name="热门推荐1",sort=105},
	[10] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>凯西、雷吉奇卡斯、裂空座</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249003>地绝阵。</div>凯西能有效提升我方宝可梦整体输出，驱散负面状态，雷吉奇卡斯前中排积攒怒气第二回合打出高额爆发，配合裂空座优秀的点杀能力造成减员。蒂安希和梦幻为队伍提供了可靠稳定的回复能力。",hero_list={{30507,30508,30509,40507,40508}},id=10,limit=0,name="热门推荐2",sort=106},
	[11] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>凯西、达克莱伊、胡帕</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249003>地绝阵。</div>凯西和雷公提升我方输出并提供一定的保护能力，达克莱伊可在敌方宝可梦阵亡后可以提供可观的回复，超梦压低血线，胡帕变身后打出巨额伤害，队伍有较高容错性。",hero_list={{40506,40508,50504,50508,50509}},id=11,limit=0,name="热门推荐3",sort=107},
	[12] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>裂空座、帕路奇亚、盖欧卡</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249003>地绝阵。</div>裂空座、帕路奇亚、盖欧卡一回合压低对手血线，第二回合打出爆炸输出，利用帕路奇亚追击的特性造成对方多人减员，谢米为我方后排提供庇护，蒂安希为我方带来优秀的回复。",hero_list={{30508,30507,30502,10510,10512}},id=12,limit=0,name="初级推荐3",sort=103},
	[13] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>基拉祈、雷吉奇卡斯、凯西</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249003>地绝阵。</div>凯西为全队增伤，提供庇护，皮卡丘驱散敌方增益buff，基拉祈为队友提供回复的同时又有不俗的输出，雷吉奇卡斯半防半输出，可以在第二回合打出高额爆发。",hero_list={{30511,30509,40503,40507,40508}},id=13,limit=0,name="热门推荐4",sort=108},
	[14] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>雷吉奇卡斯，莱希拉姆，凤王</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249003>地绝阵。</div>凤王在友方暴击时能为我方提供高额的生命回复，快龙保护我方后排宝可梦也能打出不俗的伤害，雷吉奇卡斯和莱希拉姆是这套阵容的主力输出。",hero_list={{30509,30507,20507,20510,20511}},id=14,limit=0,name="热门推荐5",sort=109},
	[15] = {desc="<div fontcolor=#d95014>核心宝可梦：</div><div fontcolor=#249003>洛奇亚、莱希拉姆</div>\n<div fontcolor=#d95014>推荐阵法：</div><div fontcolor=#249003>地绝阵。</div>莱希拉姆与固拉多组成灼烧队伍，洛奇亚和莱希拉姆集火敌方前排，急冻鸟降低敌方速度，雷吉艾斯提供续航，队伍输出方式多样，有优秀的续航能力。",hero_list={{10505,10502,10511,20510,20504}},id=15,limit=0,name="初级推荐4",sort=104},
}
